// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
import "./PheasantNetworkBridgeChild.sol";

contract Helper is PheasantNetworkBridgeChild {
    constructor(
        address[] memory _tokenAddressList,
        uint256 _userDepositThreshold,
        address _disputeManager
    ) PheasantNetworkBridgeChild(_tokenAddressList, _userDepositThreshold, _disputeManager) {}

    function helperBid(address user, uint256 index) public {
        super.bid(user, index);
    }

    function setUpTrade(
        address sender,
        uint256 index,
        address user,
        uint8 tokenTypeIndex,
        uint256 amount,
        uint256 timestamp,
        address to,
        address relayer,
        uint8 status,
        uint256 fee,
        uint256 disputeTimestamp,
        bool isDeposit
    ) public {
        trades[sender].push(
            Trade(
                index,
                user,
                tokenTypeIndex,
                amount,
                timestamp,
                to,
                relayer,
                status,
                fee,
                disputeTimestamp
            )
        );

        userTradeList.push(UserTrade(msg.sender, trades[msg.sender].length - 1));

        if(isDeposit) {
            IERC20 token = IERC20(tokenAddressL2[tokenTypeIndex]);
            require(token.transferFrom(msg.sender, address(this), amount), "Transfer Fail");
        }
    }

    function setUpEvidence(
        address user,
        uint256 index,
        Evidence calldata evidence
    ) public {
        evidences[user][index] = evidence;
    }

    function helperCheckTransferTx(
        bytes calldata transaction,
        address recipient,
        uint256 amount
    ) public pure returns (bool) {
        return super.checkTransferTx(transaction, recipient, amount);
    }

    function helperWithdraw(
        address user,
        uint256 index,
        Evidence calldata evidence
    ) public {
        super.withdraw(user, index, evidence);
    }
}
